    public static Page getUrl(Request request) throws FetchFailureException, FetchDomainBannedException, IOException {
        if (Environment.isProductEnv()) {
            return downloadPageByMtDownloader(request);
        } else {

            return handleResponse(request, TestDownloader.downloadStr(request.getUrl()), 200, null);
        }
    }

    private static Page downloadPageByMtDownloader(Request request) throws FetchFailureException, FetchDomainBannedException, IOException {
        RequestParam params = RequestParam.newDefaultReqParam();
        params.setUseCache(true);
        params.setProxyType("adsl");
        params.setUseProxy(true);
        LOGGER.info("Downloading Request url :" + request.getUrl());
        WebPage webpage = FetchClientHelper.getInstance().fetch(request.getUrl(), params);
        String html = webpage.getSrcHtml();
        int statusCode = webpage.getHttpcode();
        return handleResponse(request, html, statusCode, null);
    }


    protected static Page handleResponse(Request request, String html, int StatusCode, Task task) throws IOException {
        Page page = new Page();
        page.setRawText(html);
        page.setUrl(new PlainText(request.getUrl()));
        page.setRequest(request);
        page.setStatusCode(StatusCode);
        return page;
    }

